A Lexer reads input bytes (InputStream) or characters (Reader), until
one of its terminals is fulfilled. This happens when the Parser calls
<i>getNextToken()</i>. The terminals will be set by the Parser on init.
<p>
Usage:
<pre>
SyntaxSeparation separation = new SyntaxSeparation(new Syntax(myRules));
LexerBuilder builder = new LexerBuilder(separation.getLexerSyntax(), separation.getIgnoredSymbols());
Lexer lexer = builder.getLexer(inputStream);
lexer.setTerminals(separation.getTokenSymbols());
Token token;
do	{
token = lexer.getNextToken(null);
System.err.println("token.symbol="+token.symbol+", text >"+token.text+"<");
}
while (token.symbol != null && Token.isEpsilon(token) == false);
boolean error = token.symbol == null;
</pre>

A LexerSemantic that provides the Set of wanted String nonterminals
by method reflection. Callback methods must be of the form
<pre>
	public void EncodingDecl(ResultTree resultTree)	{
		this.encodingDecl = resultTree.toString();
	}
</pre>

Created on 21.09.2005

Semantic base class that tries to call methods with the same name as nonterminal on left side of rule. The number of parameters of the method must be the same as the number of symbols on the right side of the rule, all parameters must be of type Object, and the return type must be Object. The method might process the parse results and return an arbitrary Object to be processed by another callback method. The ranges of the currently dispatched rule is available by protected getRanges() method.
<p/>
Example: Both rules

<pre>
		expression ::= expression "+" term ;
		expression ::= expression "-" term ;
</pre>

would be dispatched by

<pre>
public Object expression(Object expression, Object operator, Object term)
{
    int e = ((Integer) expression).intValue();
    int t = ((Integer) term).intValue();
    if (operator.equals(&quot;+&quot;))
        return new Integer(e + t);
    else if (operator.equals(&quot;-&quot;))
        return new Integer(e - t);
    else
        throw new IllegalArgumentException(&quot;Unknown operator: &quot; + operator);
}
</pre>

Separates lexer from parser rules. Provides token and ignored symbols after construction, which can be used for LexerBuilder construction.
<p>
Example:

<pre>
SyntaxSeparation separation = new SyntaxSeparation(new Syntax(myRules));
LexerBuilder builder = new LexerBuilder(separation.getLexerSyntax(), separation.getIgnoredSymbols());
Lexer lexer = builder.getLexer();
// when using the lexer standalone, you must put the token terminal symbols into it now:
lexer.setTerminals(separation.getTokenSymbols());
// when using a Parser the Parser will do this:
</pre>

ArtificialRule is needed to
<ul>
<li>create nonterminals and rules for symbols within parenthesis: "(a b c)" -> "_a_b_c_"</li>
<li>create nonterminals and rules for symbols that were quantified with "*", "+", "?"</li>
</ul>
The nonterminal names get created from symbols that are converted to names.
Every created nonterminal starts with "_" (Token.ARTIFICIAL_RULE_START_CHARACTER).
<p>
Example:
<pre>
sentence1 ::= word* ;
sentence2 ::= word+ ;
sentence3 ::= word? ;
</pre>
will be converted to following rules
<pre>
_sentence1_OPTLIST ::= _sentence1_LIST;
_sentence1_OPTLIST ::= ;
_sentence1_LIST ::= _sentence1_LIST word;
_sentence1_LIST ::= word;

_sentence2_LIST ::= _sentence2_LIST word;
_sentence2_LIST ::= word;

_sentence3_OPT ::= word;
_sentence3_OPT ::= ;
</pre>

This class can be called using SourceGenerator by commandline.
<p>
Generates Java code that contains empty method bodies for the
implementation of a given Syntax. For every rule there will
be a method with the name of the nonterminal on the left side
and one argument for each symbol on the right side. All arguments
are of type Object.
The created implementation derives <i>ReflectSemantic</i>.
<pre>
File in = new File("MySyntax.grammar);
String basename = "MySemantic";
Writer out = new FileWriter(basename+".java");
new SemanticSkeletonGenerator(in, basename, "my.pkg.name", out);
// the Java source "my/pkg/name/MySemantic.java" will be generated
</pre>
